import { InfoService } from './info.service'

export default {
  name: 'ModalNoticeDetail',
  bem: {
    b: 'modal-common-notify-info'
  },
  serviceInject() {
    return {
      service: InfoService
    }
  },
  rxState() {
    const { info$, brand$ } = this.service
    return {
      info$,
      brand$
    }
  },
  computed: {
    logo() {
      return '~@/assets/img/notify_logo.png'
    }
  },
  props: {
    record: Object
  },
  data() {
    return {
      show: false,
      notifyConfig: {}
    }
  },
  methods: {
    onCancel() {
      this.$emit('cancel')
    }
  }
}
